	first VARCHAR NOT NULL CHECK(first != ''),
	last VARCHAR NOT NULL CHECK(last != ''),
    email VARCHAR NOT NULL UNIQUE CHECK(email != ''),
	hashedPw VARCHAR NOT NULL CHECK(hashedPw != ''),
	profile_pic VARCHAR,
	bio VARCHAR,
	created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

